import React from 'react'

export default function ProjectsCards(image, title, description) {
  return (
    <div className='div__card'>
        <div>
        <img src={image} alt="card-img" />
        </div>
        <div>
          {/*   <h4>{title}</h4> */}
        <p>
            {description}
        </p>
        </div>
    </div>
  )
}
